import React from 'react'

const nav = (props) => {
  return (
    <div className="main-header-center">
      <div className="nav-menu d-none d-sm-flex">
        {props.links.map(link => {
          return <div className="nav-menu-item-first"><a href={"#" + link.name1 + "-" + link.name2}>{link.name}</a></div>
        })}
      </div>
    </div>
  )
}

export default nav;
